import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation } from "swiper/modules";
import "swiper/css";
import "swiper/css/navigation";

const Carousel = ({photos}) => {
  return (
    <div>
      <Swiper
        modules={[Navigation]}
        navigation
        loop={true}
        spaceBetween={40}
        slidesPerView={1}
        className="Carousel"
      >
        {photos.map((item) => (
          <SwiperSlide key={item.id}>
            <div className="Carousel__card" style={{backgroundImage: `url(${item.img})`}}>
              {item.title}
            </div>
          </SwiperSlide>
        ))}
      </Swiper>
    </div>
  );
};

export default Carousel;
